 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Multiple-Choice-Fragen werden meist in formalen Tests verwandt.\nSie k\u00f6nnen jedoch auch genutzt werden, um neue \u00dcberlegungen\nanzusto\u00dfen oder Diskussionen zu Themen zu f\u00f6rdern, bei denen\ndie Teilnehmer\/innen eher etwas zur\u00fcckhaltend sind.\n\nBeachten Sie bei der Erstellung von Multiple-Choice-Fragen folgendes:<ul>\n<li>Welches Lernergebnis wollen Sie mit den Fragen erzielen?<\/li>\n<li>Welche intellektuellen F\u00e4higkeiten wollen Sie testen?<\/li>\n<li>Welche sprachlichen F\u00e4higkeiten haben Ihre Teilnehmer\/innen?<\/li>\n<li>Gibt es geschlechtsspezifische Aspekte oder kulturelle Unterschiede zu beachten?<\/li>\n<li>Beachten Sie Satzbau und Grammatik, damit die Fragen gut verst\u00e4ndlich sind!<\/li>\n<\/ul>\n ", 
