 "Please enter<br \/>an idevice name.": "Tragen Sie eine Bezeichnung <br \/>f\u00fcr den iDevice ein.", 
 "\n        <h2>Click The Elements in Order Game<\/h2>\n        <p>\n                This builds a Javascript game where the player has to click on a certain place on the main area according to the hint.  \n                When they click correctly the positive feedback will come and the game will advance.  When they click the wrong\n                area negative feedback will be shown.  When they click on the correct area an item can be revealed there.  A delay\n                can be set to make the item disappear if desired after a delay.\n        <\/p>\n\n        ": "\n        <h2>Spiel: In Reihenfolge anklicken<\/h2>\\n\n        <p>\n                Hiermit erstellen Sie ein javascript-basiertes Spiel, in dem die Spieler\/-innen entsprechend der Anleitung auf eine bestimmte Stelle (Hotspot) in einem vorgegebenen Bereich klicken m\u00fcssen.  \n                Wenn sie die richtige Stelle erwischen, erhalten sie ein positives Feedback und kommen sie im Spiel weiter. \n               Wenn sie auf eine falsche Stelle klicken, erscheint ein negatives Feedback.\n               Wenn die richtige Stelle angeklickt wird, kann dort ein Item aufgedeckt werden. F\u00fcr dieses Item kann eine Zeit definiert werden, nach der das Item wieder verschwindet, sofern gew\u00fcnscht.\n         <\/p>\n\n         ", 
