 "Bosnian ": "Bosnisch", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nDas Bild mit Text iDevice kann emotionale (affektive) Aspekte und  kognitive Aufgaben\nunterst\u00fctzen. Ein Beispiel f\u00fcr beide Optionen macht das deutlicher:\n<\/p><p>\n<b>Trainerprofil (emotionale Dimension)<\/b>\n<\/p><p>\nForschungsergebnisse betonen, dass viele Lerner einen pers\u00f6nlichen Zugang\nbevorzugen. Eine M\u00f6glichkeit hierzu ist die kurze Darstellung des Trainers und\nanderer am Lernprozess Beteiligter. Das Profil (am besten mit Foto)\nkann nicht nur zur Darstellung der Rolle und Kompetenzen\ngenutzt werden. Anmerkungen zum gemeinsamen Lernprozess, dem Umgang\nmiteinander (Spielregeln) und mit dem Medium Computer und den Inhalten\nk\u00f6nnen hier ebenfalls dargestellt werden. Achten Sie beim Verfassen des Textes\nauf eine \"gut verst\u00e4ndliche\" Sprache.\n<\/p><p>\n<b>Bilder mit Texterkl\u00e4rungen<\/b>\n<\/p><p>\nKognitionspsychologen weisen darauf hin, dass die Darstellung von \nBildern mit dazu passenden textlichen Zusammenfassungen\ndie Aufmerksamkeit f\u00f6rdert und das Behalten erleichtert.\nDieses iDevice kann zur Darstellung von Bildern (Fotos, Diagramme oder\nGrafiken) mit einer kurzen Beschreibung der wichtigsten Punkte\nder Abbildung genutzt werden. Wenn Sie z.B. die Funktion eines 4-Takt-Motors\nerl\u00e4utern wollen, kann jedes Bild eine Phase darstellen und der Text diese\nkurz erl\u00e4utern.\n<\/p>", 
 "Creative Commons Attribution Non-commercial No Derivatives License 2.5": "Creative Commons Attribution Non-commercial No Derivatives License 2.5", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>L\u00fcckentexte oder L\u00fcckentests enthalten einen Text, in dem einzelne Worte\/Begriffe  bewusst ausgelassen wurden. Teilnehmer\/innen m\u00fcssen hier die fehlenden Begriffe einsetzen. Diese Testform wird h\u00e4ufig benutzt:<\/p> <ol> <li>um Grundkenntnisse von Konzepten zu pr\u00fcfen<\/li><li>um Vokabelkenntnisse zu kontrollieren <\/li><li>um das Leseverst\u00e4ndnis zu testen<\/li><li>um Wortstellung und Grammatik zu pr\u00fcfen.<\/li>", 
