 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitilization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Wenn die Funktion deaktiviert bleibt, werden kleinere Fehler bei der Bewertung nicht ber\u00fccksichtigt. Wenn die Funktion aktiv ist, muss buchstabengetreu richtig geantwortet werden und Gro\u00df- und Kleinschreibung korrekt sein.<\/p><p><strong>Beispiel:<\/strong> Die richtige Antwort lautet <code>Elefant<\/code> und beide Ergebnisse <code>elefant<\/code> und <code>Elifant<\/code> werden richtig bewertet weil sie <em>\"nah genug\"<\/em> an der richtigen L\u00f6sung sind (nur ein Buchstabe ist jeweils falsch), sofern \"Gro\u00df-\/Kleinschreibung\" aktiv ist.<\/p><p>Wenn Gro\u00df-\/Kleinschreibung abgeschaltet ist wird die Kleinschreibung <code>e<\/code> nicht als Fehler gewertet und <code>elifant<\/code> wird ebenfalls akzeptiert.<\/p><p>Wenn sowohl \"Strenge Bewertung\" als auch \"Gro\u00df-\/Kleinschreibung\" aktiviert sein, wird nur \"Elefant\" als richtig gewertet. Wenn nur \"Strenge Bewertung\" aktiv ist und \"Gro\u00df-\/Keinschreibung\" nicht aktiv ist, wird \"elephant\" als richtig gewertet.<\/p>", 
