 "Teachers should keep the following in mind when using this iDevice: <ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "Trainer\/innen sollten folgende Hinweise beim Erstellen von iDevices beachten:<ol><li>Zu viele verschiedene \u00dcbungsformen k\u00f6nnten die Teilnehmer\/innen irritieren. Zumeist reichen drei oder vier verschiedene Arten v\u00f6llig aus.<\/li><li>Vermeiden Sie mehrere iDevices direkt hintereinander ohne einen Informationstext dazwischen, der Orientierung gibt.<\/li><li>Achten Sie auf den Zeitaufwand zur Bearbeitung einer \u00dcbung. Er sollte in einem angemessenen Verh\u00e4ltnis zum Lerneffekt stehen.<\/li><\/ol>", 
